import React, {useState} from 'react'

export default function ListManager(props){

    const [list, setList] = useState(props.list)

    return (
        <ul>
            {
                list.map((el, index) => {
                    
                        return <li key={index}>{el}</li>
                    
                })
            }
        </ul>
    )
}
